import React from "react";
import repair from '../../../../Assets/Images/phoneRepair/iPhoneRepair.jpg';
import styles from './RepairQuote.module.css';


const repairQuote = (props) => (
    <div className={styles.Main}>
        <img src={repair} />

        <div>
            <h2>iPhone {props.model} Repair Services</h2>
            <ul>
                <li>Complete LCD Replacement</li>
                <li>Not Charging</li>
                <li>Liquid Damage</li>
                <li>Battery Replacement</li>
            </ul>
        </div>
    </div>

)

export default repairQuote;
